import React from 'react';

function Blog() {
  const posts = [
    { id: 1, title: 'My First Blog Post', excerpt: 'This is a short excerpt from my first blog post...', date: '2023-06-01' },
    { id: 2, title: 'Learning React', excerpt: "Here are some things I've learned about React...", date: '2023-06-15' },
    { id: 3, title: 'The Power of CSS Grid', excerpt: 'CSS Grid has revolutionized web layout...', date: '2023-06-30' },
  ];

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold text-purple-600 mb-4">Blog</h1>
      <div className="space-y-4">
        {posts.map(post => (
          <div key={post.id} className="border border-purple-200 rounded p-4">
            <h2 className="text-2xl font-bold text-purple-600 mb-2">{post.title}</h2>
            <p className="text-black mb-2">{post.excerpt}</p>
            <p className="text-sm text-gray-500">{post.date}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Blog;
